INSERT INTO `artist` (`id`, `name`, `description`, `type`, `headerImg`, `thumbnailImg`) VALUES
(1, 'Afrojack', 'Nick Leonardus van de Wall (born 9 September 1987), better known as Afrojack, is a Dutch DJ, record producer and remixer from Spijkenisse. In 2007, he founded the record label Wall Recordings; his debut album Forget the World was released in 2014. Afrojack regularly features as one of the ten best artists in the Top 100 DJs published by DJ Mag. He is also the CEO of LDH Europe.\r\nSince 2007, Afrojack runs his own label, Wall Recordings, which represents producers including KIIDA, Apster, D-Wayne, D.O.D, Karim Mika, and others. The label used to operate as a sub-label to Spinnin\' Records until late January 2016. Tom & Jame\'s Burn Down marked the last release of Wall Recordings as a sub-label. After going independent for a while, it became a sub-label to Armada Music in 2017, until it became independent again in 2019.', 'dance', 1, 1),
(2, 'Armin Van Buuren', 'Armin Jozef Jacobus Daniël van Buuren (born 25 December 1976) is a Dutch DJ and record producer from Leiden, South Holland. Since 2001, he has hosted A State of Trance (ASOT), a weekly radio show, which is broadcast to nearly 40 million listeners in 84 countries on over 100 FM radio stations. According to the website DJs and Festivals, \"the radio show propelled him to stardom and helped cultivate an interest in trance music around the world.\"\r\nIn 2017, Armin van Buuren announced he will be releasing an online MasterClass sharing his expertise in electronic music production. On 13 April 2017, Armin van Buuren performed at the Heineken stage in Shanghai, in the first Formula 1 Festival along with Angela Zhang.\r\nArmin performed a seven-hour-long set at the Romania Untold Festival on 6 August 2018, clocking from 2:00 a.m. to after 9:00 a.m. This outlasted his previous 2017 ASOT performance, which had gone on for five hours.', 'dance', 2, 2),
(3, 'Hardwell', 'Robbert van de Corput (born 7 January 1988), known professionally as Hardwell, is a Dutch DJ, record producer and remixer from Breda. Hardwell was voted the world\'s number one DJ on DJ Mag in 2013 and again in 2014. He was ranked at number twelve in the top 100 DJs 2019 poll by DJ Mag. Hardwell is best known for his sets at music festivals, including Ultra Music Festival, Sunburn and Tomorrowland.\r\nOn his debut studio album, United We Are, he used trance music synths for the first time for his track \"Echo\" as well as deep house sounds for \"Birds Fly\". In addition, \"Chameleon\" is based on the jungle-terror genre, which was similar with the W&W single \"Get Down\". For the first time since \"Don\'t Stop the Madness\", \"Hollywood\" embodies a track corresponded to the dirty-German-music.', 'dance', 3, 3),
(4, 'Nicky Romero', 'Nick Rotteveel (born 6 January 1989), professionally known as Nicky Romero or Monocule, is a Dutch DJ, record producer and remixer from Amerongen, Utrecht Province. He has worked with, and received support from DJs, such as Tiësto, Fedde le Grand, Sander van Doorn, David Guetta, Calvin Harris, Armand van Helden, Avicii and Hardwell. He currently ranks at number 26 on DJ Mag\'s annual Top 100 DJs poll. He is known for his viral hit song \"Toulouse\".\r\nAs Romero has become more popular, he has become the target of criticism from underground music producers and underground music satire web articles; subjects include his actual abilities and contribution to the electronic music canon. Critics have targeted his style, his appearance and his music-production abilities. Such suggestions describes elements of Romero\'s abilities as brief and insufficient. Romero has since rebuffed the suggestions as minor.', 'dance', 4, 4),
(5, 'Tiesto', 'Tijs Michiel Verwest ( born 17 January 1969), known professionally as Tiësto, is a Dutch DJ and record producer from Breda, North Brabant. He was voted \"the Greatest DJ of All Time\" by Mix magazine in a 2010/2011 poll amongst fans. In 2013, he was voted by DJ Mag readers as the \"best DJ of the last 20 years\". He is also regarded as the \"Godfather of EDM\" by many sources.\r\nIn 1997, he founded the label Black Hole Recordings with Arny Bink, where he released the Magik and In Search of Sunrise CD series. Tiësto met producer Dennis Waakop Reijers in 1998; the two have worked together extensively since then.\r\nFrom 1998 to 2000, Tiësto collaborated with Ferry Corsten under the name Gouryella. His 2000 remix of Delerium\'s \"Silence\" featuring Sarah McLachlan exposed him to more mainstream audiences. ', 'dance', 5, 5),
(6, 'Martin Garrix', 'Martijn Gerard Garritsen (born 14 May 1996), known professionally as Martin Garrix, is a Dutch disc jockey who was ranked number one on DJ Mag\'s Top 100 DJs list for three consecutive years—2016, 2017, and 2018. His most known singles are \"Animals\", \"In the Name of Love\" and \"Scared to Be Lonely\". He is also known by his pseudonyms \"Ytram\" and \"GRX\".\r\nHe has performed at music festivals such as Coachella, Electric Daisy Carnival, Ultra Music Festival, Tomorrowland, and Creamfields. In 2014 he headlined the 1st edition of Ultra South Africa making this his first major festival. In the same year he became the youngest DJ to headline 2014 Ultra Music Festival at the age of 17. He was a resident DJ at Spain\'s Hï Ibiza (2017) and Ushuaïa Ibiza (2016 and 2018). He founded the label Stmpd Rcrds in 2016, months after leaving Spinnin\' Records and before signing with Sony Music.', 'dance', 6, 6);

