INSERT INTO `venue` (`id`, `name`, `description`, `type`, `image`) VALUES
(1, 'Club Stalker', 'Club Stalker was a disco in the old center of Haarlem . The business opened in 1983 and closed in 2019.\r\nThe building used to be a warehouse , where Felix van der Eerden opened Club Stalker in 1983 , at a time when the nightlife in the big cities was not much. The name was taken from the film Stalker by Andrei Tarkovsky. \r\nThe club played almost all kinds of electronic music : it started with New Wave and Postpunk , then House , Hip Hop , UK Garage and Drum and Bass and later mainly Minimal and Techno . It was also the first club outside the RoXY where DJ Joost van Bellen played. Because of the programming, Stalker was regarded as one of the better nightclubs in the Netherlands.\r\n\r\nYou can find us at Kromme Elleboogsteeg 20, 2011 TS Haarlem. We are open Thursday to Sunday 11pm to 5am. Our contact number 023 531 4652.', 'dance', 1),
(2, 'Caprera Openluchttheater', 'In 1948, an open-air theater was built at Hoge Duin and Daalsweg 2 in Bloemendaal, to a design by civil servant A. Bos, beautifully situated in the dunes. This makes it attractive not only during performances but also as a walking park.\r\nThe number of seats is approximately 1000 and the playing surface is 30 meters wide and 15 meters deep.\r\nThe theater opened on September 1, 1948 with a performance of \"Don Quixote at the wedding of Kamacho\" by Pieter Langendijk, directed by Louis Saalborn . The players came from amateur groups in the area.\r\n\r\nYou can find us at Hoge Duin en Daalseweg 2, 2061 AG Bloemendaal. Our contact number 023 525 0050.', 'dance', 2),
(3, 'Jopenkerk', 'Jopen is a beer brewery from Haarlem, Netherlands. Jopen\'s beer is a result of the work of Stichting Haarlems Biergenootschap, which was founded in 1992. The mission of the Biergenootschap is to re-create traditional Haarlem beers and bring them to the commercial market. Two recipes were found in the Haarlem city archives that were used as a foundation for two initial beers. The first one was a recipe from 1407; the recreation of this was named Koyt, a gruit beer.\r\nIn December 1996, the commercial company Jopen BV acquired the beer. The name Jopen refers to the 112 litre beer barrels that were used in early times to transport the Haarlem beer. Until the end of 1996 Jopen beer was brewed in the Halve Maan brewery in Hulst, after that it was made in the La Trappe brewery in Berkel-Enschot.\r\n\r\nYou can find us at Gedempte Voldersgracht 2, 2011 WD Haarlem. We are open Monday to Sunday from 10am to 1am. Our contact number 023 533 4114.', 'dance', 3),
(4, 'Lichtfabriek', 'The Lichtfabriek in Haarlem is the perfect location for business events such as trade fairs, conferences, staff parties, company presentations or meetings. Why? All our event spaces can be fully customized , the industrial look & feel provides a unique experience and we have 50 free guarded parking spaces in front of the door. Everything is possible and we always think along with you. Since the covid-19 measures have come into effect, we have greatly reduced our rates for photoshoots and TV and film productions. Curious about the possibilities?\r\n\r\nYou can find us at Energieplein 73, 2031 TC Haarlem. We are open Monday to Friday 9am to 5pm. Our contact number 023 303 0500.', 'dance', 4),
(5, 'Club Ruis', 'Club Ruis welcomes you to the old part of Haarlem. Club Ruis, on the Grote Markt, is the ideal location in the center of Haarlem for lunch, dinner or just a drink. Next to the Café on the ground floor, there is a restaurant on the first floor where you can dine with groups of 10 people or more. You have a magnificent view over the square and the town hall. The attic of Club Ruis is very suitable for business meetings, such as a meeting location, but also for a party or private dining. \r\n\r\nYou can find us at Smedestraat 31, 2011 RE Haarlem. We are open Friday to Sunday 11pm to 5am. Our contact number 023 743 5914.', 'dance', 5),
(6, 'XO The Club', 'Grand Café XO welcomes you to the old part of Haarlem. XO, on the Grote Markt, is the ideal location in the center of Haarlem for lunch, dinner or just a drink. Next to the Café on the ground floor, there is a restaurant on the first floor where you can dine with groups of 10 people or more. You have a magnificent view over the square and the town hall. The attic of XO is very suitable for business meetings, such as a meeting location, but also for a party or private dining. All rooms as described above can be booked separately.\r\n\r\nYou can find us at Grote Markt 8, 2011 RD Haarlem. We are open Thursday to Sunday 11pm to 5am. Our contact number 023 551 1350.', 'dance', 6);

